}
#savingsBox h4 { margin:4px 0 6px 0; font-size:14px; color:#333; }
#savingsValue { font-size:22px; font-weight:bold; color:#27ae60; }
</style>
</head>

  .attr("transform","translate("+barX+","+(barY+3*barSpacing+35)+")");
legend.selectAll("rect").data(legendData).enter()
  .append("rect").attr("x",(d,i)=>i*180).attr("y",0).attr("width",14).attr("height",14)
  .attr("fill",d=>d.color);
legend.selectAll("text").data(legendData).enter()
  .append("text").attr("x",(d,i)=>i*180+20).attr("y",12).text(d=>d.label);

const barG = svg.append("g");
const pctG = svg.append("g");

function metrics(tCut){
  const total = rawData.length;
  const sum = fn => {
    const arr = rawData.filter(fn);
    return { acc:arr.length, def:arr.filter(d=>d["Good/Bad Flag"]===1).length };
  };
  const bank = sum(d=>d["Bank Internal Score"]<=bankCut);
  const telc = sum(d=>d["FinScore Telco"]>=tCut);
  const comb = sum(d=>d["Bank Internal Score"]<=bankCut && d["FinScore Telco"]>=tCut);
  const filtShare = rawData.filter(d=>d["Bank Internal Score"]<=bankCut && d["FinScore Telco"]<tCut).length/total;

  const sec = (o)=>{const g=(o.acc-o.def)/total,b=o.def/total;return {good:g,bad:b};};
  const bsec=sec(bank), tsec=sec(telc), csec=Object.assign(sec(comb),{filtered:filtShare});
  bsec.reject=1-bsec.good-bsec.bad;
  tsec.reject=1-tsec.good-tsec.bad;
  csec.reject=1-csec.good-csec.bad-csec.filtered;

  const baseDef = bank.acc?bank.def/bank.acc:0;
  const combDef = comb.acc?comb.def/comb.acc:0;

  return {
    sections:[bsec,tsec,csec],
    accRates:[bsec.good+bsec.bad,tsec.good+tsec.bad,csec.good+csec.bad],
    defRates:[
      bank.acc?bank.def/bank.acc:0,
      telc.acc?telc.def/telc.acc:0,
      comb.acc?comb.def/comb.acc:0
    ],
    saved:(baseDef-combDef)*pesoPerLoan
  };
}

function draw(cut){
  const m = metrics(cut);
  barG.selectAll("*").remove();
  const keys=["good","bad","filtered","reject"];
  m.sections.forEach((bar,i)=>{
    let x=barX;
    keys.forEach(k=>{
      const w=(bar[k]||0)*barWidth;
      if(w<=0) return;
      barG.append("rect").attr("x",x).attr("y",barY+i*barSpacing)
          .attr("width",w).attr("height",barHeight)
          .attr("fill",schemes[k]);
      x+=w;
    });
  });

  pctG.selectAll("*").remove();
  m.accRates.forEach((a,i)=>{
    pctG.append("text")
      .attr("x",barX+barWidth+10)
      .attr("y",barY+i*barSpacing+barHeight/2+4)
      .attr("class","percent-text")
      .text("A: "+(a*100).toFixed(1)+"%  D: "+(m.defRates[i]*100).toFixed(1)+"%");
  });

  document.getElementById("savingsValue").textContent = "₱ "+Math.round(m.saved).toLocaleString();
}

const slider=document.getElementById("telcoSlider");
const out=document.getElementById("sliderVal");
slider.addEventListener("input",()=>{out.textContent=slider.value;draw(+slider.value);});

let play=false, timer;
document.getElementById("playBtn").addEventListener("click",function(){
  play=!play;
  this.textContent= play? "Pause":"Play";
  if(play){
    timer=setInterval(()=>{
      let v=(+slider.value+1)%11;
      slider.value=v; out.textContent=v; draw(v);
    },1500);
  }else clearInterval(timer);
});

draw(+slider.value);
</script>
</body>
</html>
